INSERT INTO `posts` VALUES (40,0,'\\\"What do we do?\\\" you ask','what-we-do','<p>We eliminate and prevent fraud at each Point-of-Transaction (POT) globally.</p>\r\n<p>With 75 out of 100 financial transaction performed via electronic transmission we are well poised to assist the growing number of buyers and sellers to eliminate fraud, waste, abuse, identity fraud, identity theft and terrorist acts.</p>\r\n\r','',0,2,'disabled',0,1336103755,2,0,0,0,0,0,''),(41,0,'Who is it for?','who-is-it-for','<p>Consumers are welcome to join our Family with NO FEE!</p>\r\n<p>Merely fill out our online form and upload your headshot only picture. You can even save and come back later to complete your enrollment. It\\\'s that easy!</p>\r\n<p>Businesses are urged to contact us directly to receive our low introductory offer.</p>\r\n\r','',0,3,'disabled',0,1336103790,2,0,0,0,0,0,''),(42,0,'Welcome','welcome','<div id=\\\"headsup_front_page_video_player\\\"><object classid=\\\"clsid:d27cdb6e-ae6d-11cf-96b8-444553540000\\\" codebase=\\\"http://download.macromedia.com/pub/shockwave/cabs/flash/swflash.cab#version=6,0,40,0\\\" height=\\\"427\\\" width=\\\"680\\\"><param name=\\\"loop\\\" value=\\\"false\\\" />\n<param name=\\\"play\\\" value=\\\"false\\\" />\n<param name=\\\"wmode\\\" value=\\\"transparent\\\" />\n<param name=\\\"quality\\\" value=\\\"high\\\" />\n<param name=\\\"movie\\\" value=\\\"http://headsup.cc/headsup_front_page_video_player.swf\\\" />\n<embed height=\\\"427\\\" loop=\\\"false\\\" play=\\\"false\\\" pluginspage=\\\"http://www.macromedia.com/go/getflashplayer\\\" quality=\\\"high\\\" src=\\\"http://headsup.cc/headsup_front_page_video_player.swf\\\" type=\\\"application/x-shockwave-flash\\\" width=\\\"680\\\" wmode=\\\"transparent\\\" /></object></div>\n<p>HeadsUp, LLC eliminates fraud, waste, and abuse with our \\\"patented pending\\\" product(s), systems, methods, and innovated concepts.</p>\n','',0,1,'disabled',0,1336103829,2,1343700929,2,0,0,0,''),(43,0,'Mortgage Safety','mortgage-safety','<p>By adopting our video product to each point-of-transaction i.e. store, loan officer\\\'s desktop, loan pipeline, etc\\; you sustain a culture that places a high value on helping consumers thrive by treating all consumers fairly.</p>\r\n<p><img class=\\\"mauto\\\" src=\\\"/media/images/loan_officer-1.jpg\\\" /></p>\r\n<p>Our \\\"patented pending\\\" video system and vetting process of industry insiders and consumers will give the public confidence that financial markets are fair and stable. We believe this promotes growth, efficiency, and innovation for you, over the long-term.</p>\r\n<p>Pursuant to the proposed Consumer Financial Protection Act (CFPA) and the Wall Street Reform Act we strengthen banks, Intermediaries, and Non-Bank banks transparency, simplicity, fairness, and accountability mandates. This eliminates your litigation and administrative penalties.</p>\r\n<p>By tying back all financial transaction to the vetted video image, our product ensures that your bank provides:</p>\r\n<ul class=\\\"list-style-check\\\">\r\n<li>Consumers have the information they need (vetted industry insiders) to make responsible financial decisions.</li>\r\n<li>Consumers are protected from abuse, unfairness, deception, discrimination, or fraud.</li>\r\n<li>Consumers financial service markets operate fairly and efficiently with ample room for sustainable growth and innovation\\;</li>\r\n<li>and Traditionally underserved consumers and communities have access to lending, investment, and financial services via Geo-coding pursuant to census tract data requirements and the CRA.</li>\r\n<li>We are your liaison for consumer complaint collection, tracking, and follow-up.</li>\r\n<li>We provide objective web-based financial education for your customers that improve their ability to manage their own financial affairs and to make their own judgments about the appropriateness of certain financial products.</li>\r\n<li>There is community affair functions that promote community development, investment, and fair and impartial access to credit. We are engaged in a wide variety of feedback from the local level of activities identified by census tract to help you, the financial institution, community based organizations, government entities, and the public understand and address financial service issues that affect low and middle-income people across various census tracts i.e. eminent domain issues, CRA, predatory lending, reverse mortgages, etc.</li>\r\n<li>Consumers can verify their ability with our technology that they understand their risk and costs which are later folded into a qualitative and statistical format for you, the bank, for compliance, auditing, and reporting. For example, we deploy a calculator disclosure for consumers to select a different payment amount, duration, or interest rate for comparison shopping of mortgages to avoid negative amortization, option ARM, underwater appraisals, etc.</li>\r\n<li>Consumers are warned at the point-of-transaction during a debit, credit, or ATM transaction to consider the costs and benefits of the use of such a product and that doing-so would overdraft their account.</li>\r\n<li>To speak to a financial institution\\\'s account executive please complete the below information and submit. We will contact you within 24 hours to get you set-up.</li>\r\n</ul>\r\n\r','',0,2,'disabled',0,1336103886,2,0,0,0,0,0,''),(44,0,'Mortgage Risk','mortgage-risk','<p>We emphasis mortgage fraud prevention at the application stage with a focus on day one fraud elimination. It may be appreciated that fraud prevented early, in day one, for you the lender, is an economic benefit to you the lender who currently absorbs $4 - $6 Billion annual costs, according to the FBI.</p>\r\n<ol>\r\n<li>Mortgage loan fraud can be divided into two broad categories:</li>\r\n<li>FRAUD FOR PROPERTY: Fraud for property generally involves material misrepresentation or omission of information with the intent to deceive or mislead a lender into extending credit that would likely not be offered if the true facts were known. The fraudulent activities observed in the suspicious activity report (SAR) describing fraud for property include: asset fraud\\; occupancy fraud\\; employment and income fraud\\; debt elimination fraud\\; identity theft\\; and straw buyers.</li>\r\n<li>FRAUD FOR PROFIT: Fraud for property is generally committed by home buyers attempting to purchase homes for their personal use. In contrast, the motivation behind fraud for profit is money. Fraud for profit is often committed with the complicity of industry insiders such as commissioned driven mortgage brokers, real estate agents, property appraisers, and settlement agents (attorneys and title examiners).\r\n<p>Typical fraudulent activities associated with this category in the SAR filing sampling are: Appraisal fraud\\; fraudulent flipping\\; straw buyers\\; deed theft\\; and identity theft.</p>\r\n<h4>Pre-Regulatory Risk of Mortgage Fraud</h4>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<th>Mortgage Scam Problems</th>\r\n<th>Vetted Insider Solutions</th>\r\n</tr>\r\n<tr>\r\n<td>Straw Buyers</td>\r\n<td>Loan Originators</td>\r\n</tr>\r\n<tr>\r\n<td>Deed Thieves</td>\r\n<td>Loan Officers</td>\r\n</tr>\r\n<tr>\r\n<td>Foreclosure Fraud</td>\r\n<td>RE Appraisers</td>\r\n</tr>\r\n<tr>\r\n<td>Property Flipping</td>\r\n<td>Loan Closers</td>\r\n</tr>\r\n<tr>\r\n<td>Closing Fraud</td>\r\n<td>RE Lawyers</td>\r\n</tr>\r\n<tr>\r\n<td>Appraisal Fraud</td>\r\n<td>Loan Processors</td>\r\n</tr>\r\n<tr>\r\n<td>Income Fraud</td>\r\n<td>Mortgage Underwriters</td>\r\n</tr>\r\n<tr>\r\n<td>Predatory Lending</td>\r\n<td>Sales Brokers &amp\\; Agents</td>\r\n</tr>\r\n<tr>\r\n<td>Debt Elimination Fraud</td>\r\n<td>Housing Counselors</td>\r\n</tr>\r\n<tr>\r\n<td>CRA Reverse Lending</td>\r\n<td>Title Agents</td>\r\n</tr>\r\n<tr>\r\n<td>Occupancy Fraud</td>\r\n<td>Deed Recording Officials</td>\r\n</tr>\r\n<tr>\r\n<td>Identity Fraud of Senior Citizens</td>\r\n<td>Mortgage Modification Outfits</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</li>\r\n</ol>\r\n\r','',0,1,'disabled',0,1336104252,2,1336104271,2,0,0,0,''),(45,0,'Credit Card Risks','credit-card-risks','<p><img src=\\\"/media/images/credit_card_fraud-1.png\\\" /></p>\r\n<p>Credit card fraud costs merchants $2 billion. It costs card issuers, acquires, and card associations $48 billion USD last year. The costs incurred by merchants and financial institutions are passed onto consumers in the form of higher prices, interest rates, and fees.</p>\r\n<p>Overall, a victim spends on average $1,180.00 plus 175 hours over a four-year period to regain their financial health. Worldwide, losses due to credit card fraud from organized crime may amount to as much as $2 trillion USD reaching epidemic levels in Canada, Japan, and Europe. Debit card fraud losses from Signatures are more than 12 times losses than PIN transactions - $245 Million vs. $20 Million in 2007.</p>\r\n<p>Today, global spending with general purpose credit and debit cards exceeds $3.2 trillion USD, and that is only a small portion of what economists estimate to be a market of more than $20 trillion USD. Oil, travel and entertainment, plus department store cards, as distinguished from general purpose cards, also represent a large potential fraud market. Furthermore, the UK has reported a 70\\% increase in the number of reported cases of identity fraud in the second half of 2009, compared with the same period in 2008 according to a new report from global information solutions provider Experian.</p>\r\n<p>Europeans make more than 23 billion card transaction every year worth over 1.35 euros trillion ($1.94 trillion). Nellie Kroes, Commissioner of the EU Anti-Trust commission ordered in December 2008, that Multilateral interchange fee agreements such as MasterCard\\\'s inflate the cost of card acceptance by retailers. Consumers foot the bill, as they risk paying twice for payment cards: once through annual fees to their bank and a second time through inflated retail prices paid not only by card users but also by customers paying cash. The Commission will accept these fees only where they are clearly fostering innovation to the benefit of all users.\\\"</p>\r\n<p>Competition Commissioner Kroes has said that \\\"consumers are being ripped off by card fees.\\\" She has also characterized MasterCard and Visa Europe as \\\"an effective duopoly\\\" that makes \\\"outrageous profits.\\\"</p>\r\n<p>The fees in question range from 0.4 percent to 1.20 percent per transaction, considerably less than the rate in the U.S., which averages 2.14 percent. All consumers pay the fees, even those who use cash or checks, because card company rules force retailers to build the fees into all transactions. Visa will have to stop charging interchange fees on these payments as well, according to the Commission, when its exemption from EU competition laws expires on December 31, 2007. Visa Europe\\\'s interchange rate is currently 0.7 percent.</p>\r\n<p>In the U.S., interchange fees cost $36.3 billion in 2006. At the current rate of increase, these fees will cost more than $40 billion in 2007 and cross the $50 billion mark in 2010.</p>\r\n<p>Merchants are pursuing more than 50 lawsuits against credit card companies and banks, charging that interchange fees are fixed in violation of the antitrust laws</p>\r\n<h4>Pre-Regulatory Risk of Credit Card Fraud</h4>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<th>Benefits of CC compliance</th>\r\n<th>CC Systemic Risk Problem</th>\r\n</tr>\r\n<tr>\r\n<td>Borrower verifies they understand</td>\r\n<td>Complex Overdraft policies</td>\r\n</tr>\r\n<tr>\r\n<td>Geo-Coding census tract data</td>\r\n<td>Trouble with CRA discrimination</td>\r\n</tr>\r\n<tr>\r\n<td>Consumer complaint tracking</td>\r\n<td>No vehicle for consumer complaints</td>\r\n</tr>\r\n<tr>\r\n<td>Interchange is tangibly justified</td>\r\n<td>Interchange appears monopolistic</td>\r\n</tr>\r\n<tr>\r\n<td>Decrease in loss provisions</td>\r\n<td>Fraud risk is metrically managed</td>\r\n</tr>\r\n<tr>\r\n<td>Elimination of day 2 fraud</td>\r\n<td>We screen day 1 new accounts</td>\r\n</tr>\r\n<tr>\r\n<td>Reduce litigation from victims</td>\r\n<td>Provide consumers with security</td>\r\n</tr>\r\n<tr>\r\n<td>We absorb compliance responsibility</td>\r\n<td>GBLA, Basel, SOX limitless expense</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n\r','',0,3,'disabled',0,1336104479,2,0,0,0,0,0,''),(46,0,'Credit Card Safety','credit-card-safety','<p>Our \\\"patented pending\\\" system and method is a card-independent preventive security tool.</p>\r\n<p>ELY INSERT .SWF VIDEO HERE</p>\r\n<p>We electronically transmit to the merchant\\\'s cash register, or financial institution\\\'s desktop, a pre-authenticated video facial image of the credit card holder during the point of transaction or new account opening process. Even an untrained merchant or bank associate can distinguish between our image and the customer in front of them.</p>\r\n<p>We act as trust brokers for individual\\\'s sensitive data\\; even once that data is lost or stolen, thereby preventing overall fraud.</p>\r\n<p>This prevents new accounts from being opened in the victim\\\'s name. Our transmissions will also be used for mail order/telephone order transactions as well as opening new accounts online and internet transactions, including video phones, for future offerings.</p>\r\n<p>Pursuant to The Consumer Financial Protection Act (CFPA) we tie back your credit card transaction to the card holder\\\'s vetted biometric facial video image.</p>\r\n<p>Our product ensures that your bank provides:</p>\r\n<ul class=\\\"list-style-checked\\\">\r\n<li>Consumers have the information they need (overdraft opt-out on the spot) to make responsible financial decisions.</li>\r\n<li>Consumers are protected from abuse, unfairness, deception, discrimination, or fraud.</li>\r\n<li>Consumers have a tangible, innovative, economic benefit with technology to justify your merchant\\\'s interchange fee costs. This eliminates your litigation and administrative fine exposure under the ruling issued by Commissioner Nellie Kroes, in Brussels, and satisfies the Credit Card Act of 2009 in the United States.</li>\r\n<li>Consumers financial service markets operate fairly and efficiently with ample room for sustainable growth and innovation\\; and</li>\r\n<li>Traditionally underserved consumers and communities have access to lending, investment, and financial services via Geo-coding pursuant to census tract data requirements and the CRA.</li>\r\n<li>We are your liaison for consumer complaint collection, tracking, and follow-up.</li>\r\n<li>We provide objective web-based financial education for your customers that improve their ability to manage their own credit card affairs and to make their own judgments about the appropriateness of other financial products.</li>\r\n<li>There is community affair functions that promote community development, investment, and fair and impartial access to credit. We are engaged in a wide variety of feedback from the local level of activities identified by census tract to help you, the financial institution, community based organizations, government entities, and the public understand and address financial service issues that affect low and middle-income people across various census tracts i.e. hidden overdraft fees, excessive interchange fees, PIN vs Signature transactions, etc.</li>\r\n<li>Consumers can verify their ability with our technology that they understand their risk and costs which are later folded into a qualitative and statistical format for you, the bank, for compliance, auditing, and reporting. For example, we deploy a calculator disclosure for consumers to select a different payment amount, annual fee, introductory interest rate or other variable for comparison shopping of credit card products.</li>\r\n<li>Consumers are warned at the point-of-transaction during a debit, credit, or ATM transaction to consider the costs and benefits of the use of such a product and that doing-so would overdraft their account.</li>\r\n<li>To speak to a financial institution\\\'s account executive please complete the below information and submit. We will contact you within 24 hours to get you set-up.</li>\r\n</ul>\r\n\r','',0,4,'disabled',0,1336104619,2,0,0,0,0,0,''),(47,0,'DHS (Department of Homeland Security) Costs','dhs--department-of-homeland-security--costs','<p>Identity fraud due to data loss, cloning, stolen data, laptop breaches, hacking, synthetic fraud, and carelessness result in monumental losses. There have been more than 246 million records containing sensitive personal information of United States citizens involved in security breaches over the past 36 monthshttp://www.privacyrights.org/ar/ChronDataBreaches.htm. These manmade vulnerabilities, threats, and attacks confront our national security and commercial enterprise security every second of every day Clearly this rises to the level of high risk assessment for appropriations and represents an attack on our institutions. These threats originate from terrorist cells, foreign and homegrown, that we are skilled in identifying.</p>\r\n<p>These attacks threaten our key points of transaction in our government with the intent of undermining our institution\\\'s stability and overall missions. Threats, vulnerabilities, and weaknesses remain in fertile territory due to dramatic increases in computing power, huge flows of information that characterize the digital age, and the absence of a clear preventive solution or standard. Together they bring enormous benefits, but also create risk of abuse. The need for sensible safeguards to balance the privacy of citizens in a democracy with the necessity to protect our homeland in this dynamic new world is strongly needed.</p>\r\n<p>Transportation ingress and egress points also represent the need for authentication, validation, and access. The need to authenticate and validate bi-directional cross-border movement by Transportation Security Administration (TSA) staff for access or denial persists on our borders. The existing program known as The United States Visitor and Immigrant Status Indicator Technology Program (US-VISIT) works in tandem with our video imaging product(s).</p>\r\n<p>For example, most individuals arriving at our borders may be returning citizens. Others will be visitors under the Visa Waiver Program (VWP) for 90 days from approved countries.</p>\r\n<p>Citizens and Nationals of the VWP countries who are traveling to the United States for business or pleasure must obtain electronic travel authorization prior to departure by registering online with the Electronic System for Travel Authorization (ESTA).</p>\r\n<p>Within government, our key points of transaction remain vulnerable to attack and include the point of validating the identity of our citizens for services disbursed or collected by our government. Services include, but are not limited to, Social Security benefits, Veterans Administration (VA) benefits, Medicare, postal services, Medicaid, Internal Revenue collections and tax credits, state social services, state motor vehicle services, state voter registration rights and services, city civil service hirings, and a multitude of other governmental key points of transactions.</p>\r\n\r','',0,1,'disabled',0,1336410314,2,0,0,0,0,0,''),(48,0,'DHS (Department of Homeland Security) Benefits','dhs--department-of-homeland-security--benefits','<p>Identity fraud due to data loss, cloning, stolen data, laptop breaches, hacking, synthetic fraud, and carelessness result in monumental losses. There have been more than 246 million records containing sensitive personal information of United States citizens involved in security breaches over the past 36 months <a>http://www.privacyrights.org/ar/ChronDataBreaches.htm</a>. These man-made vulnerabilities, threats, and attacks confront our national security and commercial enterprise security every second of every day Clearly this rises to the level of high risk assessment for appropriations and represents an attack on our institutions. These threats originate from terrorist cells, foreign and homegrown, that we are skilled in identifying.</p>\r\n<p>These attacks threaten our key points of transaction in our government with the intent of undermining our institution\\\'s stability and overall missions. Threats, vulnerabilities, and weaknesses remain in fertile territory due to dramatic increases in computing power, huge flows of information that characterize the digital age, and the absence of a clear preventive solution or standard. Together they bring enormous benefits, but also create risk of abuse. The need for sensible safeguards to balance the privacy of citizens in a democracy with the necessity to protect our homeland in this dynamic new world is strongly needed.</p>\r\n<p>Transportation ingress and egress points also represent the need for authentication, validation, and access. The need to authenticate and validate bi-directional cross-border movement by Transportation Security Administration (TSA) staff for access or denial persists on our borders. The existing program known as The United States Visitor and Immigrant Status Indicator Technology Program (US-VISIT) works in tandem with our video imaging product(s).</p>\r\n<p>For example, most individuals arriving at our borders may be returning citizens. Others will be visitors under the Visa Waiver Program (VWP) for 90 days from approved countries.</p>\r\n<p>Citizens and Nationals of the VWP countries who are traveling to the United States for business or pleasure must obtain electronic travel authorization prior to departure by registering online with the Electronic System for Travel Authorization (ESTA).</p>\r\n<p>Within government, our key points of transaction remain vulnerable to attack and include the point of validating the identity of our citizens for services disbursed or collected by our government. Services include, but are not limited to, Social Security benefits, Veterans Administration (VA) benefits, Medicare, postal services, Medicaid, Internal Revenue collections and tax credits, state social services, state motor vehicle services, state voter registration rights and services, city civil service hiring, and a multitude of other governmental key points of transactions.</p>\r\n\r','',0,1,'disabled',0,1336410387,2,0,0,0,0,0,''),(49,0,'Health Care Plan','health-care-plan','<p><img class=\\\"fr\\\" style=\\\"margin-left: 20px\\;\\\" src=\\\"/media/images/health_care_industry_logo-1.png\\\" /></p>\r\n<p>medical identity theft is the last straw\\; after crooks steal your wallet and max out the credit cards, they turn to the health insurance card for even more freebies. \\\"An insurance card is like a platinum card with a $1 million spending limit.</p>\r\n<p>When someone steals your name to receive health care, his medical history becomes part of your record -- and setting the record straight can be extremely difficult. That\\\'s because, in part, the information is dispersed among dozens of caregivers, from doctors to pharmacies to insurance companies and labs.</p>\r\n<p>Incorrect entries can prevent you from getting insurance, disqualify you for some jobs, and even lead to injury or death. Imagine arriving at the emergency room with a ruptured appendix, and your medical record shows (erroneously) that your appendix has already been removed. Doctors might waste valuable time looking for other causes.</p>\r\n<p>President Obama, argues that the new expansion of health care coverage can partially be funded by squeezing waste out of the current system. We serve at the pleasure of the President to do our part.</p>\r\n<p>The Centers for Medicare and Medicaid Services, which is the insurance end of the federal government of Medicare, report that total health care expenditures in the United States will surpass $4 trillion by 2015, which is a 139 percent increase, or more than double the $1.67 trillion expended in 2003. There are very conservative estimates, or there are estimates, that the losses due to fraudulent activity approached 10 percent of the amount of money that we expend in health care.\\\"</p>\r\n<p>Health care fraud is a type of <a title=\\\"White-Collar\\\">white-collar</a> crime that involves the filing of dishonest health care claims in order to turn a profit. Fraudulent health care schemes come in many forms:</p>\r\n<p>Practitioner schemes - include: individuals obtaining subsidized or fully-covered prescription pills that are actually unneeded and then selling them on the black market for a profit\\; billing by practitioners for care that they never rendered\\; filing duplicate claims for the same service rendered\\; altering the dates, description of services, or identities of members or providers\\; billing for a non-covered service as a covered service (up-coding)\\; modifying medical records\\; intentional incorrect reporting of diagnoses or procedures to maximize payment\\; use of unlicensed staff\\; accepting or giving kickbacks for member referrals\\; waiving member co-pays\\; and prescribing additional or unnecessary treatment.</p>\r\n<p>Member\\\'s schemes - can commit health care fraud by providing false information when applying for programs or services, forging or selling prescription drugs, using transportation benefits for non-medical related purposes, and loaning or using another\\\'s insurance card. There have been reports of medical identity fraud causing patients to receive the wrong blood type.</p>\r\n<p>An audit of the government program in five large states found about 65,000 instances of beneficiaries improperly obtaining potentially addictive drugs at a cost of about $65 million during 2006 and 2007  including About 1,800 prescriptions written for dead patients and 1,200 prescriptions \\\"written\\\" by dead physicians.</p>\r\n<p>California, Illinois, New York, North Carolina and Texas  accounted for 40\\% of Medicaid\\\'s prescription drug payments in fiscal years 2006 and 2007. They are not fully taking advantage of federal databases or technology that could spot fraud, the report said.</p>\r\n\r','',0,1,'disabled',0,1336410577,2,0,0,0,0,0,''),(50,0,'Health Care Fraud Remedy','health-care-fraud-remedy','<p>Our \\\"patented pending\\\" product of vetted patients, doctors, pharmacists, and other industry professionals are electronically transmitted during exams, pharmacy pickup, and other key points of transactions.</p>\r\n<p>We believe that biometric video image is a step in the right direction of innovation, technical databases, fraud elimination, and electronic health records.</p>\r\n<p>ELY PLEASE CROP THE 3 IMAGES INTO THE MONITORS ABOVE</p>\r\n<p>JMK</p>\r\n<p>People think this is about big insurance companies, but there are real victims -- real people who went through pain.</p>\r\n\r','',0,1,'disabled',0,1336410639,2,0,0,0,0,0,''),(51,0,'Mortgage Specialist Training Requirements','mortgage-specialist-training-requirements','<p>Loan officers around the country have begun taking federally mandated licensing exams, which many in the industry consider beneficial for borrowers in the long run.</p>\r\n<p>The exam is not required of everyone  only those who work for mortgage brokerages and lenders like Quicken Loans or Primerica. Employees of conventional banks like Bank of America and JPMorgan Chase need only register with the National Mortgage Licensing System, which is administered by the state banking supervisors.</p>\r\n<p>Prospective licensees in 11 states began taking the exams on July 30, followed in late October by those in six more states and Washington. On Dec. 10, New York and New Jersey started offering the tests, which feature roughly 100 questions in the national version and about 50 for the state version.</p>\r\n<p>Test questions came in part from a pool of hundreds provided by industry executives and regulators. The four sections cover federal laws, general mortgage knowledge, the loan-origination process and ethics.</p>\r\n<p>The content of the state exams varies, but in New York, for instance, there are sections on the functions of the state banking department\\; mortgage licensing requirements\\; practices barred and required by state law\\; and penalties for violations, among other things.</p>\r\n<p>The exams are largely a response to the mortgage industry collapse, which according to some critics was a result of poorly qualified and unregulated loan officers\\\' providing loans to borrowers who had little chance of paying them off.</p>\r\n<p>According to the Conference of State Banking Supervisors, which oversees the testing, 31 percent of the roughly 10,000 people who took the national test from July 30 to Nov. 30 failed it, and about 27 percent did not pass the state-specific component.</p>\r\n<p>Applicants who fail the test must wait 30 days before they can try again. If they don\\\'t pass the test by the state-imposed deadline, they cannot lend in the state. (In New York and New Jersey, the deadline is July 31, 2010, and in Connecticut, the deadline date is yet to be finalized.) Licenses are renewed yearly. While loan offices need only pass the exams once, they must keep up with various continuing education requirements.</p>\r\n\r','',0,1,'disabled',0,1336410700,2,0,0,0,0,0,''),(52,0,'Testing Post 3234','testing-post-3234','<div style=\\\"width: 80\\%\\\">\r\n<h3>Title goes here</h3>\r\n<table border=\\\"1\\\" cellpadding=\\\"0\\\" cellspacing=\\\"0\\\" style=\\\"width:150px\\;float: right\\\">\r\n<caption style=\\\"border:solid 1px black\\\"><strong>Table title</strong></caption>\r\n<tbody>\r\n<tr>\r\n<td>&nbsp\\;</td>\r\n<td>&nbsp\\;</td>\r\n<td>&nbsp\\;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp\\;</td>\r\n<td>&nbsp\\;</td>\r\n<td>&nbsp\\;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp\\;</td>\r\n<td>&nbsp\\;</td>\r\n<td>&nbsp\\;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Type the text here</p>\r\n</div>\r\n<p>&nbsp\\;</p>\r\n\r','',0,1,'disabled',0,1338850570,2,0,0,0,0,0,'');
